import MainLayout from "../Components/MainLayout";
import { useEffect, useState } from "react";
import api from "../api";
import { Users, FileText, Contact } from "lucide-react";
import { PieChart, Pie, Cell, Tooltip, ResponsiveContainer } from "recharts";

const COLORS = ["#3b82f6", "#10b981", "#f59e0b", "#ef4444"];

const AdminDashboard = () => {
  const [stats, setStats] = useState({ users: 0, invoices: 0, leads: 0, admins: 0 });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const usersRes = await api.get("/users");
        const invoicesRes = await api.get("/invoices");
        const leadsRes = await api.get("/leads");

        setStats({
          users: usersRes.data.filter(u => u.role === "user").length,
          admins: usersRes.data.filter(u => u.role === "admin").length,
          invoices: invoicesRes.data.length,
          leads: leadsRes.data.length,
        });
      } catch (err) {
        console.error("Admin Dashboard load error:", err.response?.data || err.message);
      } finally {
        setLoading(false);
      }
    };
    fetchStats();
  }, []);

  if (loading) return <MainLayout><p>Loading dashboard...</p></MainLayout>;

  const pieData = [
    { name: "Users", value: stats.users },
    { name: "Invoices", value: stats.invoices },
    { name: "Leads", value: stats.leads },
    { name: "Admins", value: stats.admins },
  ];

  return (
    <MainLayout>
      <h1 className="text-3xl font-bold mb-6">Admin Dashboard</h1>

      {/* Quick Stats */}
      <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mb-8">
        <div className="bg-white shadow rounded-lg p-6 flex items-center gap-4">
          <Users size={28} className="text-blue-500" />
          <div>
            <p className="text-sm text-gray-500">Users</p>
            <p className="text-2xl font-bold">{stats.users}</p>
          </div>
        </div>
        <div className="bg-white shadow rounded-lg p-6 flex items-center gap-4">
          <FileText size={28} className="text-green-500" />
          <div>
            <p className="text-sm text-gray-500">Invoices</p>
            <p className="text-2xl font-bold">{stats.invoices}</p>
          </div>
        </div>
        <div className="bg-white shadow rounded-lg p-6 flex items-center gap-4">
          <Contact size={28} className="text-yellow-500" />
          <div>
            <p className="text-sm text-gray-500">Leads</p>
            <p className="text-2xl font-bold">{stats.leads}</p>
          </div>
        </div>
        <div className="bg-white shadow rounded-lg p-6 flex items-center gap-4">
          <Users size={28} className="text-red-500" />
          <div>
            <p className="text-sm text-gray-500">Admins</p>
            <p className="text-2xl font-bold">{stats.admins}</p>
          </div>
        </div>
      </div>

      {/* Pie Chart */}
      <div className="bg-white shadow rounded-lg p-6">
        <h2 className="text-xl font-semibold mb-4">Resource Distribution</h2>
        <ResponsiveContainer width="100%" height={300}>
          <PieChart>
            <Pie data={pieData} dataKey="value" nameKey="name" outerRadius={100} label>
              {pieData.map((entry, index) => (
                <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
              ))}
            </Pie>
            <Tooltip />
          </PieChart>
        </ResponsiveContainer>
      </div>
    </MainLayout>
  );
};

export default AdminDashboard;
